import "./UserForm.css";

const UserForm = () => {
  return (
    <form>
      <div className="form">
        <div className="lable">Enter Name</div>
        <div className="input">
          <input type="text"></input>
        </div>

        <div className="lable">Enter Age</div>
        <div className="input">
          <input type="number"></input>
        </div>
        <button type="submit">E</button>
      </div>
    </form>
  );
};

export default UserForm;
